import React, {useState} from "react";
import { NavLink } from "react-router-dom";
import { Link } from "react-scroll";
import Logo from "../img/finallogo.png";
import Signupop from "./Signupop";
const Navbar = () => {
  const[openProfile, setOpenProfile] = useState(false);
  return (
    <div class="navbar">
      <div class="container">
        <div class="logo">
          <img src={Logo} alt="Logo" /> 
        </div>
        <div class="link">
         <h6><strong>CARE CLUB</strong></h6>
        </div>
        <div class="links">
          <NavLink class="link" to="/">
            <h6>Home</h6>
          </NavLink>
          <span class="link" onMouseOver = {() => setOpenProfile((prev) => !prev)}>
            <h6>SignUp</h6>
          </span>
          {
            openProfile &&  <Signupop/>
          }
          <NavLink class="link" to="/login">
            <h6>Login</h6>
          </NavLink>
          <Link class="link" to="gallery" smooth = {true} duration = {1000}>
              {/* gallery link */}
            <h6>Gallery</h6>
          </Link>
          <Link class="link" to="feedback" smooth = {true} duration = {1000}>
            {/* feedback link  */}
            <h6>Reviews</h6>
          </Link>
          <Link class="link" to="contactinfo" smooth = {true} duration = {1000}>
            {/* footer link  */}
            <h6>Contact Info</h6>
          </Link>
          {/* <span>Profile</span>
          <span>LogOut</span> */}
        </div>
      </div>
    </div>
  );
}

export default Navbar;
